// React Native Bottom Navigation
// https://aboutreact.com/react-native-bottom-navigation/

import * as React from 'react';
import {
  TouchableOpacity,
  StyleSheet,
  View,
  Text,
  SafeAreaView,
} from 'react-native';
import * as Linking from 'expo-linking';

const HomeScreen = ({ navigation }) => {
  return (
    <SafeAreaView style={{ flex: 1 }}>
      <View style={{ flex: 1, padding: 16 }}>
        <View
          style={{
            flex: 1,
            alignItems: 'center',
            justifyContent: 'center',
          }}>
          <Text
            style={{
              fontSize: 25,
              textAlign: 'center',
              marginBottom: 16,
            }}>
            SuEz Bid App.
          </Text>
          <TouchableOpacity
            style={styles.buttonClean}
            onPress={() => {
                Linking.openURL('exp://exp.host');
            }}>
            <Text style={styles.buttonCleanText}>Clean Application</Text>
           </TouchableOpacity>
          <TouchableOpacity
            style={styles.button}
            onPress={() => 
              navigation.navigate('Settings')
              // navigation.navigate('SettingsScreen', { screen: 'Settings' })
            }>
            <Text>Go to settng Tab</Text>
          </TouchableOpacity>
          <TouchableOpacity
            style={styles.button}
            onPress={() => navigation.navigate('Photos')}>
            <Text>View photos</Text>
          </TouchableOpacity>
          <TouchableOpacity
            style={styles.button}
            onPress={() => navigation.navigate('Details')}>
            <Text>Open Details Screen</Text>
          </TouchableOpacity>
        </View>
        <Text style={{ fontSize: 16, textAlign: 'center', color: 'grey' }}>
          Suez.bid Application
        </Text>
        <Text style={{ fontSize: 12, textAlign: 'center', color: 'grey' }}>
          www.suez.bid
        </Text>
      </View>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  button: {
    alignItems: 'center',
    backgroundColor: '#DDDDDD',
    padding: 10,
    width: 300,
    marginTop: 16,
  },
  buttonClean: {
    alignItems: 'center',
    backgroundColor: '#aa0000',
    padding: 10,
    width: 300,
    marginTop: 16,
  },
  buttonCleanText: {
    color : 'white',
  },
});
export  default HomeScreen;

export const HomeStack = () => {
  return (
    <Stack.Navigator
      initialRouteName="Home"
      screenOptions={{
        headerStyle: { backgroundColor: '#0275d8' },
        headerTintColor: '#fff',
        headerTitleStyle: { fontWeight: 'bold' },
      }}>
      <Stack.Screen
        name="Home"
        component={HomeScreen}
        options={{ title: 'About SuEz Bid0' }}
      />
      <Stack.Screen
        name="Photos"
        component={PhotosScreen}
        options={{ title: 'About SuEz Bidc2' }}
      />
      <Stack.Screen
        name="Details"
        component={DetailsScreen}
        options={{ title: 'Details Page' }}
      />
      <Stack.Screen
        name="Settings"
        component={SettingsScreen}
        options={{ title: 'Profile Page ===' }}
      />
    </Stack.Navigator>
  );
}
